webpackJsonp([0x8d6f034763a1f800],{"./node_modules/json-loader/index.js!./.cache/json/entry-2013-12-25-team-geak.json":function(n,e){n.exports={data:{site:{siteMetadata:{title:":-)",author:"github.com/9renpoto"}},markdownRemark:{id:"/home/travis/build/9renpoto/entry/src/pages/2013-12-25-team-geak/index.md absPath of file >>> MarkdownRemark",html:"<h1>メモ</h1>\n<p>人間関係に悩んでおり、以下の本を読んでおりました。</p>\n<p>読み終えたので簡単な感想をメモ。</p>\n<ul>\n<li>\n<p>大切</p>\n<ul>\n<li>謙虚</li>\n<li>信頼</li>\n<li>尊敬</li>\n</ul>\n</li>\n<li>\n<p>オープンに</p>\n<ul>\n<li>上の人は質問に堂々と答える</li>\n<li>下の人な恐れず質問する</li>\n</ul>\n</li>\n<li>\n<p>責任</p>\n<ul>\n<li>重要</li>\n<li>自分事化</li>\n</ul>\n</li>\n</ul>\n<p>まず今までの失敗を繰り返さぬよう沢山実践して、違う失敗しよう。</p>\n<blockquote>\n<p>マーケティングの人のことを考えるとゾッとするのはなぜだろうか？\nそれはエンジニアリング文化と相入れないからだ．\nぼくたちの文化は「事実」に満ちあふれている．\nコードはコンパイル「できる」と「できない」しかない．\nソフトウェアは機能を「持つ」と「持たない」しかない．\n問題は解決「できる」と「できない」しかない．\n説明を「引き伸ばす」ことはしない．事実だけを話す．</p>\n<p>Brian W.Fitzpatrick, Ben Collins-Sussman（2013)\n『Team Geek Googleのギークたちはいかにしてチームを作るのか』株式会社オライリー・ジャパン 150pp.</p>\n</blockquote>\n<p>学びとは少しそれた話ですが、上記の言葉が何よりも共感できました。</p>\n<p>自分はエンジニアで居心地が良い。</p>",frontmatter:{title:"読書 Team Geek",date:"December 25, 2013"}}},pathContext:{path:"/entry/2013/12/25/team-geak/"}}}});
